import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import authService from '../services/authService';
import '../styles/register.css';  // Ajusta la ruta según tu proyecto

function Register() {
  const navigate = useNavigate();

  // Estado con todos los campos que necesitamos
  const [formData, setFormData] = useState({
    nombre: '',
    apellidos: '',
    fechaNacimiento: '', // Guardaremos el valor como cadena 'dd/mm/yyyy'
    email: '',
    password: '',
    confirmPassword: ''
  });

  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // Maneja cambios en todos los inputs
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Envío del formulario
  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validación de contraseñas
    if (formData.password !== formData.confirmPassword) {
      setError('Las contraseñas no coinciden');
      return;
    }

    try {
      // Envía formData completo al servicio de registro
      await authService.register(formData);
      setSuccess('Registro exitoso, ya puedes iniciar sesión.');
      // Redirige al login después de unos segundos o inmediatamente
      setTimeout(() => {
        navigate('/');
      }, 2000);
    } catch (err) {
      setError('Error en el registro. Inténtalo de nuevo.');
    }
  };

  return (
    <div className="register-container">
      <form onSubmit={handleSubmit} className="register-form">
        <h2 className="form-title">Crear Cuenta</h2>

        {error && <p className="error">{error}</p>}
        {success && <p className="success">{success}</p>}

        {/* Campo de Nombre */}
        <div className="input-wrapper">
          <label htmlFor="nombre" className="sr-only">Nombre</label>
          <div className="input-icon-container">
            <i className="fa fa-user icon" aria-hidden="true"></i>
            <input
              type="text"
              name="nombre"
              id="nombre"
              placeholder="Tu nombre"
              value={formData.nombre}
              onChange={handleChange}
              required
            />
          </div>
        </div>

        {/* Campo de Apellidos */}
        <div className="input-wrapper">
          <label htmlFor="apellidos" className="sr-only">Apellidos</label>
          <div className="input-icon-container">
            <i className="fa fa-users icon" aria-hidden="true"></i>
            <input
              type="text"
              name="apellidos"
              id="apellidos"
              placeholder="Tus apellidos"
              value={formData.apellidos}
              onChange={handleChange}
              required
            />
          </div>
        </div>

        {/* Campo de Fecha de Nacimiento (texto con placeholder dd/mm/yyyy) */}
        <div className="input-wrapper">
          <label htmlFor="fechaNacimiento" className="sr-only">Fecha de nacimiento</label>
          <div className="input-icon-container">
            <i className="fa fa-calendar icon" aria-hidden="true"></i>
            <input
              type="text"
              name="fechaNacimiento"
              id="fechaNacimiento"
              placeholder="dd/mm/yyyy"
              value={formData.fechaNacimiento}
              onChange={handleChange}
              required
            />
          </div>
        </div>

        {/* Campo de Email */}
        <div className="input-wrapper">
          <label htmlFor="email" className="sr-only">Email</label>
          <div className="input-icon-container">
            <i className="fa fa-envelope icon" aria-hidden="true"></i>
            <input
              type="email"
              name="email"
              id="email"
              placeholder="example@gmail.com"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>
        </div>

        {/* Campo de Contraseña */}
        <div className="input-wrapper">
          <label htmlFor="password" className="sr-only">Contraseña</label>
          <div className="input-icon-container">
            <i className="fa fa-key icon" aria-hidden="true"></i>
            <input
              type="password"
              name="password"
              id="password"
              placeholder="********"
              value={formData.password}
              onChange={handleChange}
              required
            />
          </div>
        </div>

        {/* Campo de Confirmación de Contraseña */}
        <div className="input-wrapper">
          <label htmlFor="confirmPassword" className="sr-only">Confirmar Contraseña</label>
          <div className="input-icon-container">
            <i className="fa fa-check icon" aria-hidden="true"></i>
            <input
              type="password"
              name="confirmPassword"
              id="confirmPassword"
              placeholder="********"
              value={formData.confirmPassword}
              onChange={handleChange}
              required
            />
          </div>
        </div>

        <button type="submit" className="register-btn">Registrar</button>
      </form>

      <p className="login-link">
        ¿Ya tienes una cuenta? <a href="/">Inicia sesión</a>
      </p>
    </div>
  );
}

export default Register;
